import React from 'react';
import { SearchContainer } from './styles';
import Img from '../../assets/lupa.png';

const SearchBar = ({ value, onchange }) => {
    return (
        <SearchContainer>
            <img src={Img} />
            <input type="text" value={value} onChange={onchange} />
        </SearchContainer>
    );
}

export default SearchBar;
